    false,nt"url": null,nt"notes": "This annual narrative report for Nebraska
    WPAs outlines accomplishments during the 1968 calendar year. The report begins by
    summarizing the weather conditions, habitat conditions, water conditions, and food
    and cover conditions during the year. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, and fish-
    is also covered. The development and maintenance section discusses physical developments,
    plantings, collections and receipts, and vegetation control. The public relations
    section of the report describes recreational uses, hunting, fishing, violations,
    and safety. Photographs, brochures, and newspaper articles are attached.",nt"owner_org":
